import networkx as nx

import matplotlib.pyplot as plt

#Converts dictionary into individual graphs for each episode
def dictToNetworkXGraph(dictionary):
    graphArray  =  []
    for episode in dictionary:
        graphArray.append(episodeToNetworkXGraph(dictionary,episode))
    return graphArray

#converts specific episode in a dictionary to a graph
def episodeToNetworkXGraph(dictionary,episode):
    G = nx.Graph()
    for node, neighbors in dictionary[episode].items():
        for neighbor, weight in neighbors.items():
            if weight != 0:
                G.add_edge(node, neighbor, weight=weight)
    return G

#Calculates the degree centrality of a graph
def degreeCentralityOfEpisode(graph):
    ep_degree_centrality = nx.degree_centrality(graph)
    return ep_degree_centrality

#Calculates the degree centrality of an array of graphs    
def degreeCentralityOfGraphArray(graphArray):
    degreeCentralityArray = []
    for graph in graphArray:
        degreeCentralityArray.append(degreeCentralityOfEpisode(graph))
    return degreeCentralityArray

def averageDegreeCentrality(graph):
    degree_centralities = nx.degree_centrality(graph)
    average_degree_centrality = sum(degree_centralities.values()) / len(degree_centralities)
    print("Average degree centrality:", average_degree_centrality)

def arrayAverageDegreeCentrality(graphs):
    print("===============================================")
    counter = 1
    for g in graphs:
        print("Graph ",counter,": ", end="")
        averageDegreeCentrality(g)
        counter+=1


#Prints the degree centrality of a graph
def printDegreeCentrality(degree_centrality):
    print("===============================================")
    for node, centrality in degree_centrality.items():
        print(f"Node {node}: Degree Centrality = {centrality}")
    return degree_centrality

def individualClusteringCoefficient(graph):
    print("===============================================")
    node_clustering_coefficients = nx.clustering(graph)
    for node, cc in node_clustering_coefficients.items():
        print(f"Node {node}: Clustering Coefficient = {cc}")


def arrayAverageClusteringCoefficient(graphs):
    print("===============================================")
    counter = 1
    for g in graphs:
        print("Graph ",counter,": ", end="")
        averageClusteringCoefficient(g)
        counter+=1

def averageClusteringCoefficient(graph):
    avg_clustering_coefficient = nx.average_clustering(graph)
    print("Average Clustering Coefficient:",avg_clustering_coefficient)

def arrayDensityGraph(graphs):
    print("===============================================")
    counter = 1
    for g in graphs:
        print("Graph ",counter,": ", end="")
        graphDensity(g)
        counter+=1

def graphDensity(graph):
    print("===============================================")
    density = nx.density(graph)
    print("Density of the graph:", density)

def betweenessCentrality(graph):
    print("===============================================")
    betweeness_centrality = nx.betweenness_centrality(graph)
    for node, centrality in betweeness_centrality.items():
        print(f"Node {node}: Betweenness Centrality = {centrality}")


#print the degreeDistribution of each node in a graph
def degreeCalculation(graph):
    print("===============================================")
    degrees = dict(graph.degree())
    for node in graph.nodes():
        print(f"Node {node}: Degree {degrees[node]}")

    
def rankedNodesByWeight(graph):
    # Calculate total edge weights for each node
    node_weights = {node: sum(weight for _, _, weight in graph.edges(node, data='weight')) for node in graph.nodes()}

    # Optionally, normalize node weights
    max_weight = max(node_weights.values())
    normalized_weights = {node: weight / max_weight for node, weight in node_weights.items()}

    # Rank nodes based on total edge weights
    ranked_nodes = sorted(normalized_weights.items(), key=lambda x: x[1], reverse=True)

    # Print ranked nodes
    for node, weight in ranked_nodes:
        print(f"Node {node}: Total Edge Weight = {weight}")


def communityDetectionGraph(G):
    communities_generator = nx.algorithms.community.girvan_newman(G)
    communities = next(communities_generator)

    # Assign community labels to nodes
    community_dict = {}
    for idx, community in enumerate(communities):
        for node in community:
            community_dict[node] = idx

    nx.set_node_attributes(G, community_dict, 'community')

    # Visualize the communities
    pos = nx.spring_layout(G)  # Positions nodes using the Fruchterman-Reingold force-directed algorithm
    plt.figure(figsize=(10, 6))

    # Create a list of community labels for each node
    community_labels = [data['community'] for node, data in G.nodes(data=True)]

    # Draw the graph with nodes colored by their community labels
    nx.draw(G, pos, node_color=community_labels, cmap=plt.cm.tab10, with_labels=True)
    plt.title('Community Detection using Louvain Method')
    plt.show()


def generateInteractionGraph(G):
    # Calculate edge weights from the graph (assuming edge attributes 'weight' are already present)
    weights = [data['weight'] for _, _, data in G.edges(data=True)]

    # Generate layout for the graph
    pos = nx.spring_layout(G, k=0.99, iterations=20)

    # Plot the graph
    fig, ax = plt.subplots(dpi=250)
    nx.draw(G, pos, with_labels=True, node_size=2000, node_color="skyblue", font_size=10, font_weight="bold", width=weights, edge_color="blue", alpha=1)
    ax.set_xticks([])
    ax.set_yticks([])

    plt.title('Interaction Graph)')
    plt.show()

def absStrongestEdgesGraph(G):
    # Initialize a new graph to store the strongest edges of each node
    strongest_edges_graph = nx.Graph()

    # Iterate over each node in the graph
    for node in G.nodes():
        # Get the incident edges of the current node
        edges = G.edges(node, data=True)
        if edges:
            # Select the edge with the highest weight
            strongest_edge = max(edges, key=lambda x: x[2]['weight'])
            # Add the strongest edge to the new graph
            strongest_edges_graph.add_edge(strongest_edge[0], strongest_edge[1], weight=strongest_edge[2]['weight'])

    # Set positions for nodes
    pos = nx.spring_layout(strongest_edges_graph, k=1, iterations=50)

    # Draw nodes and labels
    nx.draw_networkx_nodes(strongest_edges_graph, pos, node_size=700, node_color='skyblue')
    nx.draw_networkx_labels(strongest_edges_graph, pos, font_size=12, font_family='sans-serif')

    # Draw edges
    nx.draw_networkx_edges(strongest_edges_graph, pos, width=2, edge_color='black')

    # Add edge labels
    edge_labels = nx.get_edge_attributes(strongest_edges_graph, 'weight')
    nx.draw_networkx_edge_labels(strongest_edges_graph, pos, edge_labels=edge_labels)

    # Display the plot
    plt.axis('off')
    plt.show()


def biDirectionalGraph(episode):
    # Initialize a directed graph
    G = nx.MultiDiGraph()


    # Add edges to the graph
    for src, edges in episode.items():
        for dest, weight in edges.items():
            # Add each edge with its weight
            if weight!=0:
                G.add_edge(src, dest, weight=weight)
    # Draw the graph
    pos = nx.spring_layout(G,k=1,iterations=70)  # positions for all nodes

    # Draw nodes
    nx.draw_networkx_nodes(G, pos, node_size=700)

    # Draw labels
    nx.draw_networkx_labels(G, pos)

    # Iterate through all edges and draw them independently with slight offset for shared edges
    for src, dest, data in G.edges(data=True):
        weight = data['weight']
        if weight > 0:
            # Check if there are multiple edges between the same nodes
            num_edges = G.number_of_edges(src, dest)
            if num_edges > 1:
                offset = 0.1 * (num_edges - 1)
            else:
                offset = 0
            nx.draw_networkx_edges(G, pos, edgelist=[(src, dest)], width=weight/5, alpha=0.5, edge_color='b', connectionstyle=f'arc3, rad={0.1+offset}')
        else:
            nx.draw_networkx_edges(G, pos, edgelist=[(src, dest)], width=-weight/5, alpha=0.5, edge_color='r', connectionstyle='arc3, rad=0.1')

    # Show the plot
    plt.title("Directed Multigraph with Independent Edges")
    plt.axis('off')
    plt.show()


def strongestEdgesGraph(episode):
    # Create a directed multigraph
    G = nx.MultiDiGraph()

    # Add edges from the dictionary
    for src, edges in episode.items():
        for dest, weight in edges.items():
            # Add edge from source to destination with weight as label
            G.add_edge(src, dest, weight=weight)

    # Create a new graph to store only the strongest edges
    strongest_edges_G = nx.MultiDiGraph()

    # Find the strongest edge for each source node
    strongest_edges = {}
    for src, dest, data in G.edges(data=True):
        weight = data['weight']
        if src not in strongest_edges or abs(weight) > abs(strongest_edges[src][1]):
            strongest_edges[src] = (dest, weight)

    # Add only the strongest edges to the new graph
    for src, (dest, weight) in strongest_edges.items():
        strongest_edges_G.add_edge(src, dest, weight=weight)

    # Draw the graph of strongest edges
    pos = nx.spring_layout(strongest_edges_G,k=1,iterations=70)  # positions for all nodes

    # Draw nodes
    nx.draw_networkx_nodes(strongest_edges_G, pos, node_size=700)

    # Draw labels
    nx.draw_networkx_labels(strongest_edges_G, pos)

    # Draw edges with the strongest edges graph
    for src, dest, data in strongest_edges_G.edges(data=True):
        weight = data['weight']
        if weight > 0: #width=abs(weight)/5
            nx.draw_networkx_edges(strongest_edges_G, pos, edgelist=[(src, dest)], alpha=0.5, edge_color='b', connectionstyle='arc3, rad=0.1')
        else:
            nx.draw_networkx_edges(strongest_edges_G, pos, edgelist=[(src, dest)], alpha=0.5, edge_color='r', connectionstyle='arc3, rad=0.1')

    # Show the plot
    plt.title("Directed Multigraph with Strongest Edges from Each Node")
    plt.axis('off')
    plt.show()


